import { useParams } from 'react-router-dom';

/*Supplements*/
import BrainBoosters from './Products/Supplements/BrainBoosters.js';
import HeartHealth from './Products/Supplements/HeartHealth.js';
import JointHealth from './Products/Supplements/JointHealth.js';
import LiverTonic from './Products/Supplements/LiverTonic.js';
import NaturalAntiOxidants from './Products/Supplements/NaturalAntiOxidants.js';
import HormonesOralContraceptives from './Products/Supplements/HormonesOralContraceptives.js';
import SlimmingWeightMgmt from './Products/Supplements/SlimmingWeightMgmt.js';
/*Injury*/
import BluntTrauma from './Products/Injury/BluntTrauma.js';
import MuscleRelaxants from './Products/Injury/MuscleRelaxants.js';
import WoundHealing from './Products/Injury/WoundHealing.js';
/*Illness*/
import CoughCold from './Products/Illness/CoughCold.js';
import EarNoseThroat from './Products/Illness/EarNoseThroat.js';
import UrinaryIncontinence from './Products/Illness/UrinaryIncontinence.js';
import Dermatological from './Products/Dermatological/Dermatological.js';
import Disinfectants from './Products/Disinfectants/Disinfectants.js';
import MedicalTools from './Products/MedicalTools/MedicalTools.js';

function TestingProdDetails() {

    const params = useParams();
    const productid = params.productid;

    return(
        <>
            {
                productid === "brain-boosters-memory-enhancers" ? (
                    <BrainBoosters />
                ) : productid === "heart-health" ? (
                    <HeartHealth />
                ) : productid === "joint-health" ? (
                    <JointHealth />
                ) : productid === "liver-tonic" ? (
                    <LiverTonic />
                ) : productid === "natural-antioxidants" ? (
                    <NaturalAntiOxidants />
                ) : productid === "hormones-oral-contraceptives" ? (
                    <HormonesOralContraceptives />
                ) : productid === "slimming-weight-management" ? (
                    <SlimmingWeightMgmt />
                ) : productid === "BluntTrauma" ? (
                    <BluntTrauma />
                ) : productid === "MuscleRelaxants" ? (
                    <MuscleRelaxants />
                ) : productid === "WoundHealing" ? (
                    <WoundHealing />
                ) : productid === "CoughCold" ? (
                    <CoughCold />
                ) : productid === "EarNoseThroat" ? (
                    <EarNoseThroat />
                ) : productid === "UrinaryIncontinence" ? (
                    <UrinaryIncontinence />
                ) : productid === "Dermatological" ? (
                    <Dermatological />
                ) : productid === "Disinfectants" ? (
                    <Disinfectants />
                ) : productid === "MedicalTools" ? (
                    <MedicalTools />
                ) : (
                    <BrainBoosters />
                )
            }
        </>
    );
}

export default TestingProdDetails;
